import React from 'react';


const PopupBtn = (props) => {
    return(
        <div className="modal">
            <div className="modalContainer">
                <div className="modalBody">{props.trip.description}</div>
                <div className="modalClose">close</div>
            </div>
        </div>
    )
}

export default PopupBtn;
